if (typeof window !== 'undefined') {
  window.TITLE_IMAGES = TITLE_IMAGES;
}

function getTitleImagesList() {
  return Object.keys(TITLE_IMAGES).filter(key => TITLE_IMAGES[key].data && TITLE_IMAGES[key].data.length > 0);
}
function getTitleImageData(imageName) {
  return TITLE_IMAGES[imageName] ? TITLE_IMAGES[imageName].data : null;
}

function createImageFromData(imageName) {
  const imageData = getTitleImageData(imageName);
  if (!imageData) return null;
  
  const img = new Image();
  img.src = imageData;
  return img;
}
if (typeof window !== 'undefined') {
  window.getTitleImagesList = getTitleImagesList;
  window.getTitleImageData = getTitleImageData;
  window.createImageFromData = createImageFromData;
} 